def test_miniscript(settings_get, settings_set, clear_miniscript, goto_home, pick_menu_item,
                    cap_menu, try_sign):

    # try one by one
    for msc, psbt in [(msc0, psbt0), (msc1, psbt1), (msc2, psbt2), (msc3, psbt3), (msc4, psbt4),
                      (msc5, psbt5), (msc6, psbt6), (msc7, psbt7), (msc8, psbt8),(msc9, psbt9),
                      (msc10, psbt10), (msc11, psbt11), (msc12, psbt12), (msc14, psbt14),
                      (msc15, psbt15), (msc16, psbt16), (msc17, psbt17), (msc18, psbt18),
                      (msc19, psbt19), (msc20, psbt20)]:

        clear_miniscript()
        name = msc[0]
        print(name)  # debug in case of failure
        settings_set("miniscript", [msc])
        goto_home()
        pick_menu_item("Settings")
        pick_menu_item("Miniscript")  # migration happens here as we start deserializing the wallets
        time.sleep(.1)
        assert name in cap_menu()
        res = settings_get("miniscript")
        assert len(res) == 1
        assert len(res[0]) == 4  # new format (name, policy, keys, opts)
        assert res[0][0] == name
        try_sign(base64.b64decode(psbt))


def test_multisig(settings_set, settings_get, try_sign, goto_home, pick_menu_item, cap_menu,
                  clear_miniscript):
    # try one by one
    for ms, psbt in [(ms0, ms_psbt0), (ms1, ms_psbt1), (ms2, ms_psbt2), (ms3, ms_psbt3)]:
        clear_miniscript()
        name = ms[0]
        settings_set("multisig", [ms])
        goto_home()
        pick_menu_item("Settings")
        pick_menu_item("Miniscript")  # migration happens here
        time.sleep(.1)
        assert name in cap_menu()
        assert settings_get("multisig", None) is None
        msc = settings_get("miniscript")
        assert len(msc) == 1
        assert len(msc[0]) == 4  # new format (name, policy, keys, opts)
        assert msc[0][0] == name
        try_sign(base64.b64decode(psbt))

    # now try bulk migration
    clear_miniscript()
    settings_set("multisig", [ms0, ms1, ms2, ms3])
    goto_home()
    pick_menu_item("Settings")
    pick_menu_item("Miniscript")  # migration happens here
    menu = cap_menu()
    for name in ["ms0", "ms1", "ms2", "ms3"]:
        assert name in menu

    assert settings_get("multisig", None) is None
    msc = settings_get("miniscript")
    assert len(msc) == 4
    for x in msc:
        assert len(x) == 4  # new format (name, policy, keys, opts)

    for i, psbt in enumerate([ms_psbt0, ms_psbt1, ms_psbt2, ms_psbt3]):
        try_sign(base64.b64decode(psbt), miniscript="ms%d" % i)


