def test_big_guys(microsd_path, src_root_dir, goto_home, pick_menu_item, need_keypress,
                  set_seed_words, microsd_wipe, enter_complex, press_select, cap_story,
                  settings_get, press_cancel):
    # unable to import via settings_set (USB max size)
    # so good place to test migration via backup
    #
    fname0 = "big_boy_naked.7z"
    psbt0 = ''

    fname1 = "big_boy.7z"
    psbt1 = ''
    for fname, psbt in [(fname0, psbt0), (fname1, psbt1)]:
        print(fname)  # debug
        microsd_wipe()
        shutil.copy(f"{src_root_dir}/testing/data/migration_640/{fname}", microsd_path(""))
        # need some other seed as main secret as we are gonna use simulator words as tmp seed
        set_seed_words("type goat number acoustic embark allow onion express monitor pudding mutual thank")
        goto_home()
        pick_menu_item("Advanced/Tools")
        pick_menu_item("Danger Zone")
        pick_menu_item("I Am Developer.")
        pick_menu_item("Restore Bkup")
        pick_menu_item(fname)
        time.sleep(.1)
        enter_complex(32*"a", apply=False, b39pass=False)
        time.sleep(.5)
        press_select()
        time.sleep(.1)
        press_select()

        with open(microsd_path(fname.split(".")[0]+".psbt"), "w") as f:
            f.write(psbt)

        pick_menu_item("Ready To Sign")
        time.sleep(1)
        title, story = cap_story()
        assert "OK TO SEND" in title
        press_select()
        time.sleep(1)
        title, stoty = cap_story()
        assert title == "PSBT Signed"

        msc = settings_get("miniscript")
        assert len(msc) == 1
        assert len(msc[0]) == 4  # new format
        press_cancel()


